import React from "react";

import "./Logo.scss";

export type LogoProps = {
  cx?: string;
  onClick?: any;
};

export const Logo: React.FC<LogoProps> = ({ cx = "", onClick }) => {
  return (
    <img
      onClick={onClick}
      className={`Logo ${cx}`}
      src="data:img/png;base64,"
      alt=""
    />
  );
};
